import com.google.common.collect.ListMultimap;
import com.google.common.collect.ArrayListMultimap;
import java.util.HashMap;
import java.util.Map;

public class Main {
    public static void main(String[] args) {
        ListMultimap<String, Integer> multimap = ArrayListMultimap.create();
        Map<String, Integer> map = new HashMap<>();

        // Adding some values to the map
        map.put("A", 1);
        map.put("B", 2);
        map.put("C", 3);

        // Perform some operations on the map
        for (Map.Entry<String, Integer> entry : map.entrySet()) {
            System.out.println("Key: " + entry.getKey() + ", Value: " + entry.getValue());
        }

        /* write */ multimap.put("key", 42);

        // Perform other operations
        map.put("D", 4);
        map.put("E", 5);

        // Iterate and print updated map
        for (Map.Entry<String, Integer> entry : map.entrySet()) {
            System.out.println("Updated Key: " + entry.getKey() + ", Updated Value: " + entry.getValue());
        }

        // More complex operations
        ListMultimap<String, String> stringMultimap = ArrayListMultimap.create();
        stringMultimap.put("fruit", "apple");
        stringMultimap.put("fruit", "banana");
        stringMultimap.put("fruit", "cherry");

        for (String fruit : stringMultimap.get("fruit")) {
            System.out.println("Fruit: " + fruit);
        }

        /* read */ Integer value = multimap.get("key").get(0);
        System.out.println("Read value from multimap: " + value);

        // Adding more entries to the multimap
        multimap.put("key", 100);
        multimap.put("anotherKey", 200);

        // Print all values for a key in the multimap
        for (Integer val : multimap.get("key")) {
            System.out.println("Value in multimap for 'key': " + val);
        }
    }
}
